import React from "react";
import Typography from "@mui/material/Typography";
import logo from '../assets/images/logo.png'
import { Box } from "@mui/material";

export default function Header() {
  return (
    <Box sx={{
      display: "flex",
      flexDirection: "row",
      alignItems: "start",
    }}>
      <img src={logo} alt='logo' />
      <h5>Streamify</h5>
    </Box>
  );
}
